# coding=utf-8
import random
import os


def sample_dataset(file_list, sample_dir=None, sample_num=1000, samp_ids=[]):
    """
    采样数据集，存在文件里面
    file_list: 所有的文件 行数应该相同
    sample_dir: 采样后的文件存储在哪一个文件夹下面, None表示当前文件夹，后缀会加'_sample'
    """

    if not samp_ids:
        file = file_list[0]
        with open(file, 'r') as f:
            file_lens = sum(1 for line in f)

        print(file_lens)
        samp_ids = [i for i in sorted(random.sample(range(file_lens), sample_num))]
        print(samp_ids)

    for file in file_list:
        if sample_dir:
            dir_name = sample_dir
        else:
            dir_name = os.path.dirname(file)

        file_name = os.path.basename(file)
        (file_name, file_extension) = os.path.splitext(file_name)
        new_file_name = file_name + '_sample' + file_extension
        new_file_name = os.path.join(dir_name, new_file_name)
        with open(file, 'r') as f_read, open(new_file_name, 'w') as f_write:
            for index, line in enumerate(f_read):
                if index in samp_ids:
                    f_write.write(line)


